import styled from "styled-components";

const TodoGrid = styled.section`
    display: grid;
    width: 100%;
    grid-template-columns: repeat(4, 1fr);
    gap:10px;
`

const TodoBox = styled.div`
    display: flex;
    justify-content: center;
    min-height: 70px;
    border: 1px black solid;
    border-radius: 10px;
`

const DelBtn = styled.button`
    height: 20px;
`

function Todo () {

    return (
        <TodoGrid>
            <TodoBox>
                <div> 1. C </div>
                <DelBtn> DEL</DelBtn>
            </TodoBox>
            <TodoBox>
                <div> 2. D </div>
            </TodoBox>
            <TodoBox>
                <div> 3. U </div>
            </TodoBox>
            <TodoBox>
                <div> 4. Design </div>
            </TodoBox>
            <TodoBox>
                <div> 나는 투두에오 </div>
            </TodoBox>
        </TodoGrid>
    )
}

export default Todo;
